import './App.css';
import HeadBackground from './components/header/HeadBackground';
import HeadTitle from './components/header/HeadTitle';
import NextLast from './components/match/NextLast';
import UpcomingMatches from './components/match/UpcomingMatches';
import Navbar from './components/navbar/Navbar';
import image from './images/main-head.jpg';

import NewsHeadSmall from './components/news/NewsHeadSmall';
import NewsListSmall from './components/news/NewsListSmall';


export default function App() {
  return (
    <div>
      <Navbar />
      <div className="wrapper">
        <div className="container">
          <HeadBackground 
            src={image}
            />
          <HeadTitle 
            text="SPR BOR Oborniki Śląskie"
            />
          <UpcomingMatches />
        <div className="content-container">
            <NextLast />
            <NewsHeadSmall 
              src={image}
              title="Wygrywamy z Kątami Wrocławskimi 34:29!"
              text="Po zaciętym meczu w hali przy ulicy Kownackiego zwyciężamy z liderem tabeli! Nasza drużyna pomimo gry w okrojonym składzie zaprezentowała się znakomicie. Po piętnastu minutach gry...  "
            />
            <NewsListSmall />
          </div>
        </div>
      </div>
    </div>
  );
}
